/** @jsx jsx */
/** @jsxRuntime classic */
import { css, jsx } from "@emotion/core";

const HeroNavLogo = () => <h2 css={styles} src="">movieverse</h2>

const styles = css`
    font-size: 22px;
    font-weight: 800;
    margin-right: 150px;
`;

export default HeroNavLogo;
